import React from 'react'
import dataArr from '../../../CoursesFolder/MainCourseData'

const CoursesScrollBar = () => {
    return (
        <div>
            {dataArr.map((item) => (
                <button style={{ backgroundColor: "rgb(10, 43, 102)" }} onClick={() => {
                    nv(item.cLink)
                }}>
                    <img src={item.cImg} alt="" />
                </button>
            ))}
        </div>
    )
}

export default CoursesScrollBar
